import React from 'react';
import Slider from 'react-slick';
import HeroSection from '../HeroSection';
import MainSection from '../MainSection';
import Footer from '../Footer';

function LandingPage() {
  return (
    <div>
      <HeroSection />
      <MainSection />
      <Footer />
    </div>
  );
}

export default LandingPage;
